(t=>{if("outdated"in t&&t.outdated){const e=document.createElement("link");e.rel="stylesheet",e.href="BROWSERS_URIbrowsers.min.css",document.body.appendChild(e);const n=jQuery(`<section id="browser-alert"><h1>Please Update Your Browser</h1><p><strong>You are using an outdated browser, ${t.name} version ${t.version}.</strong></p><p>Outdated browsers can make your computer unsafe and may not properly work with this website.&nbsp;To ensure security, performance, and full functionality, please upgrade to an up-to-date browser.</p><ul></ul></section>`);Object.keys(t.info).forEach((e=>{const s=t.info[e],r=jQuery(`<li><a href="${s.url}" title="${s.long_name}" target="_blank"><div class="icon"><img src="BROWSERS_URI../../images/browsers/${e}.svg"></div><h2>${s.name}</h2></a><p class="info"><em>${s.info}</em></p><p class="version">Latest Version: <strong>${s.version}</strong></p><p class="website"><a href="${s.url}" title="${s.long_name}" target="_blank">Visit Official Website</a></p></li>`);n.find("ul").append(r)})),jQuery("body").append(n)}})(atob("BROWSERS_DATA"));
